        this.state = {mensajeRender : 'Mensaje inicial Render'};
    }

    componentWillMount(){
        console.log('componentWillMount Render');
    }

    render(){
        console.log('componentWillMount Render');
        // Agrupar varios elementos sin un fragment se hace con return []
